package drivers

import (
    "context"
    "logs-api/ports/drivens"
    "logs-api/models"
)

type LogsProxyAdapter struct {
    drivenAdapter drivens.LogsDrivenPort
}

func NewLogsProxyAdapter(drivenAdapter drivens.LogsDrivenPort) *LogsProxyAdapter {
    return &LogsProxyAdapter{
        drivenAdapter: drivenAdapter,
    }
}

func (lpa *LogsProxyAdapter) SaveLog(ctx context.Context, log models.ErrorLog) error {
    return lpa.drivenAdapter.SaveErrorLog(ctx, log)
}
